Mini Nursery Tour ✨ 
I wanted neutral, clean, minimal. Lots of whites with hints of light pink. & her accent animal is the 🦒 since her legs are so long. 
@babyletto for the crib, rocking chair, and dresser
@pehr for all of the 🦒 accents 
@crateandbarrel for the wicker baskets 
@target for the mirror and baby supplies
+ tons of amazon finds I will link on my stories. 
This is easily my favorite room in the house, 38 weeks, we are ready for her 💗
.
.
